- input: "TEXT\x1CC00461772\x1C.TEXT\x1C\x1CF3XN\x1COn Thursday 8/11/2011 the FEC
    File software reported an error that the dcf file was corrupt and caused the system
    to crash preventing uploading of the report. Due to the time difference we were
    not able to contact FEC tech support regarding the issue. All other programs on
    the computer worked following the error message except FEC File. Our computer
    technician worked on the system on Friday 8/12/2011 Saturday 8/13/2011 and determined
    that a possible incompatibility between FEC file and a Microsoft update caused
    the problem and restored the computer to a date previous to the update. This error
    prevented us from uploading the report until Sunday 8/14/2011.\n"
